// HomePage.js
import React from 'react';

const HomePage = ({ userData, handleLogout }) => {
  return (
    <div>
      <h2>Witaj na stronie domowej!</h2>
      {userData && (
        <div>
          <h1 style="text-align: center;">Witamy na stronie głównej</h1>
        </div>
      )}
    </div>
  );
};

export default HomePage;
